import React from 'react';
import './CSS/dashboard.css';
import SideBar from './Sidebar';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import {useEffect, useState} from 'react';
import DashboardHome from './pages/DashboardHome';
import Money from './pages/Money';
import Items from './pages/Items';
import {useNavigate} from "react-router-dom"

function Dashboard() {
  const navigate = useNavigate();
  ()=>{
    const [initialState, setIntialState] = useState([]);
    useEffect(()=>{
      fetch('http://localhost:3001/dashboardload')
      .then (res => res.json())
      .then(res => setIntialState(res))
    }, [])
    if(initialState=== "" || initialState  === undefined){
      navigate("/SignInSignUp");
    }
    else{
    console.log("Welcome username: "  + typeof initialState.username);
    }
  };
  return (
    <div>
        <SideBar>
        <Routes>
          <Route exact path='/' element ={<DashboardHome/>} />
          <Route exact path="/DashboardHome" element={<DashboardHome />} />
          <Route exact path="/Money" element={<Money />} />
          <Route exact path="/Items"  element={<Items />} />
        </Routes>
        </SideBar>
    </div>
  );
}

export default Dashboard;
